import React from 'react';

function SideMenuHeader() {
	return <div />;
}

function SideMenuItems() {
	return <ul />;
}

function SideMenuOverlay() {
	return <div />;
}

function SideMenu() {
	return (
		<div>
			<SideMenuHeader />
			<SideMenuItems />
			<SideMenuOverlay />
		</div>
	);
}

export default SideMenu;
